import './Dashboard.css'; 
import { useNavigate } from "react-router-dom";

function App() { 

    const routeReg = () =>{ 
        let path = `Register.js`; 
        navigate(path);
    }

    const routeLogin = () =>{ 
        let path = `Login.js`; 
        navigate(path);
    }
        
    return ( 
    <div className="colored-background">
    <head> <link rel="stylesheet" href="https://fonts.cdnfonts.com/css/cowboys" /> 
    </head> 
    <body> 
    <h1 className="main-title">Outlaw Network</h1> 
    {/* Button container with space between buttons */} 
    <div className="button-container"> 
    <button className="buttons" type="submit" onClick={routeReg}>Register</button> 
    <button className="buttons" type="submit" onClick={routeLogin}>Login</button> 
    </div> 
    </body> 
    </div> 
    ); 
} 

export default App;
